import React, {useEffect, useState} from "react";
import priceStore from "./Store/Price";


const TopBar = () => {
    const [btcPrice, setBtcPrice] = useState(priceStore.getState());
    useEffect(() => {
        priceStore.subscribe(() => {
            console.log(priceStore.getState());
            setBtcPrice(priceStore.getState());
        });
    }, []);

    return (
        <React.Fragment>
            <input id="search_for_coin_input" placeholder="Search for coin"/>
                <p id="top_bar_text">Want access to more data? Sign up for free!<br/>Sign up and get access to all of these features and more!</p>
                <p id={"btcPriceFeed"}>BTCUSDT: {btcPrice}</p>
        </React.Fragment>
    );
};

export default TopBar;
